def caesar_cipher(shift_amount, nth_character, special_shift_amount):
    file_path="curr.tar.gz"
    with open(file_path, 'rb') as input_file:
        ciphered_file_path = 'drive_.tmp'
        with open(ciphered_file_path, 'wb') as ciphered_file:
            byte = input_file.read(1)
            i = 0
            while byte != b'':
                if i % nth_character == nth_character - 1:
                    shift = special_shift_amount
                else:
                    shift = shift_amount
                ciphered_byte = (byte[0] + shift) % 256
                ciphered_file.write(bytes([ciphered_byte]))
                i += 1
                byte = input_file.read(1)

    with open("drive_.tmp", "rb") as f:
        data = f.read()
    reversed_data = data[::-1]
    with open("drive.tmp", "wb") as f:
        f.write(reversed_data)
    os.remove("drive_.tmp")

    print("Folder is locked.")

