# Function to encode a file using Base64 encoding
def encode_file(file_path, encoded_file_path):
    with open(file_path, "rb") as f:
        file_contents = f.read()
        encoded_contents = base64.b64encode(file_contents)
    
    with open(encoded_file_path, "wb") as f:
        f.write(encoded_contents)

# Function to decode a file using Base64 encoding
def decode_file(encoded_file_path, decoded_file_path):
    with open(encoded_file_path, "rb") as f:
        encoded_contents = f.read()
        decoded_contents = base64.b64decode(encoded_contents)
    
    with open(decoded_file_path, "wb") as f:
        f.write(decoded_contents)


